import React from "react";
import "./Intro.css";

function Intro() {
  return (
    <div className='intro'>
      <h1 className='intro_title'>
        <span className='intro_index'>01. </span>Intro
      </h1>

      <p>
        As you could see above, My name is Yohan Arejouane. I have passion for
        technology and aviation.One of my dreams was to be a part of the civil
        air transport industry and this one is already achieved as i am
        currently working for EL AL Israel Airlines since 2018.
      </p>
    </div>
  );
}

export default Intro;
